// src/utils/convert_speech_to_text.ts

import { GoogleGenAI, createUserContent, createPartFromBase64 } from "@google/genai";

/**
 * Converts speech (base64 audio) to text using Gemini API.
 *
 * @param GEMINI_API_KEY - API key for Gemini service (required)
 * @param base64SpeechData - Base64-encoded audio data (required)
 * @param mimeType - MIME type of the audio (e.g., "audio/wav", "audio/mpeg") (required)
 * @param modelName - Gemini ASR model name (default: "gemini-2.5-flash")
 *
 * @returns
 * - `{ success: true, transcript: string }` if transcription succeeds
 * - `{ success: false, error: string }` if any error occurs
 */
export async function convertSpeechToText(
  GEMINI_API_KEY: string,
  base64SpeechData: string,
  mimeType: string,
  modelName: string = "gemini-2.5-flash"
): Promise<{ success: true; transcript: string } | { success: false; error: string }> {
  try {
    // ✅ Input validation
    if (!GEMINI_API_KEY) return { success: false, error: "Missing GEMINI_API_KEY." };
    if (!base64SpeechData) return { success: false, error: "Missing base64SpeechData." };
    if (!mimeType) return { success: false, error: "Missing mimeType." };

    const ai = new GoogleGenAI({ apiKey: GEMINI_API_KEY });

    // Create a Part from base64 audio
    const audioPart = createPartFromBase64(base64SpeechData, mimeType);

    // Generate transcription
    const response = await ai.models.generateContent({
      model: modelName,
      contents: createUserContent([
        audioPart,
        "Generate a transcript of the speech format is <speech:'transcription'> and then the emotion and gender of the user in the speech in the format <emotion:'emotion'> and at last <gender:'gender'>",
      ]),
    });

    const transcript = response.text || "";

    if (!transcript) {
      return { success: false, error: "No transcript returned from Gemini." };
    }

    return { success: true, transcript };
  } catch (err) {
    return { success: false, error: "Failed to transcribe audio." };
  }
}

/**
 * Example test function for convertSpeechToText.
 * Replace `sampleBase64Audio` with actual base64 audio data for testing.
 */
async function testSTT() {
  const sampleBase64Audio = ""
  const mimeType = "audio/wav";

  const result = await convertSpeechToText(
    process.env.GEMINI_API_KEY || "",
    sampleBase64Audio,
    mimeType
  );

  if (result.success) {
    console.log("✅ Transcription succeeded:");
    console.log(result.transcript);
  } else {
    console.error("❌ Error:", result.error);
  }
}

// Run demo if executed directly
if (require.main === module) {
  testSTT();
}
